import "../App.css";
import React from "react";

function ForecastInfo(props) {
  const tomorrowLogo = {
    backgroundImage: checkTomorrowWeather(),
  };

  function checkTomorrowWeather() {
    if (props.forecastWeather[0] === "Thunderstorm")
      return "url(/thunderstormLogo.png)";
    else if (props.forecastWeather[0] === "Rain") return "url(/rainLogo.png)";
    else if (props.forecastWeather[0] === "Snow") return "url(/rainLogo.png)";
    else if (props.forecastWeather[0] === "Mist") return "url(/rainLogo.png)";
  }

  return (
    <div className="ForecastInfo">
      <div className="tomorrow" style={tomorrowLogo}></div>
      <div className="futureDays"></div>
    </div>
  );
}

export default ForecastInfo;
